  Tooltip.generateTooltip(context,attrs,rw);
  final String clickHandler=encodeClick(context,attrs);
  if (null != clickHandler && clickHandler.length() > 0) {
    rw.writeAttribute("String_Node_Str",clickHandler,null);
  }
