          addArcLimit(plus,a[1],false);
        }
 else {
          addArcLimit(minus,a[1],false);
        }
      }
 else {
        addArcLimit(plus,a[1],false);
      }
    }
  }
  return new Split(createSplitPart(plus),createSplitPart(minus));
