  if (windowSize != INFINITE_WINDOW) {
    if (getN() == windowSize) {
      eDA.addElementRolling(v);
    }
 else     if (getN() < windowSize) {
      eDA.addElement(v);
    }
  }
 else {
    eDA.addElement(v);
  }
}

