    String c=parts[0];
    if (parts[0].contains("String_Node_Str")) {
      c=parts[0].split("String_Node_Str")[1];
      msg=msg.replace(parts[0].split("String_Node_Str")[0] + "String_Node_Str","String_Node_Str");
    }
    String l=c;
