      String label=cmdLabel.getName().replaceFirst("String_Node_Str","String_Node_Str");
      if (aliases.contains(label)) {
        continue;
      }
      PluginCommand p;
      if ((p=Bukkit.getPluginCommand(label)) != null) {
        for (        String a : p.getAliases()) {
          if (aliases.contains(a)) {
            continue;
